import React from 'react';
import { BrowserRouter as Router, Route, Redirect } from 'react-router-dom';
import Users from './users/pages/Users';
import NewSong from './songs/pages/NewSong';
function App() {
  return <Router>
      <Route path="/">
        <Users />
      </Route>
      <Route path="/songs/new">
        <NewSong />
      </Route>
      <Redirect to="/" />
    </Router>;
}

export default App;
